def mid_joint(i, joints):

    if type(i) == list:
        if len(i) == 2:
            x1, y1 = joints[i[0]]
            x2, y2 = joints[i[1]]

            x = (x1 + x2) / 2
            y = (y1 + y2) / 2
            return (x, y)
        else:
            raise Exception("Mid joint for more than 2 points not implemented yet.")
    else:
        return joints[i]

