def to_w2v_format(token):

    token = token.lower()
    token = token.strip("[]")
    if "|" in token:
        token = token.split("|")[1]
    if ":" in token:
        # token is an entity. Return in w2v format: "[<qid>]"
        return "[" + token.split(":", 1)[0] + "]"
    else:
        return "[" + token + "]"

def snake_case(name):

    import re
    sub_1 = re.sub(r'(.)([A-Z][a-z]+)', r'\1_\2', name)
    return re.sub(r'([a-z0-9])([A-Z])', r'\1_\2', sub_1).lower()

