def _partition(array, low, high):

    if low >= high:
        return

    i = low + 1
    j = high
    while i <= j:
        if array[i] <= array[low]:
            i += 1
        else:
            array[i], array[j] = array[j], array[i]
            j -= 1

    array[low], array[j] = array[j], array[low]
