def binary_search(list, item):

    lower = 0
    higher = len(list) - 1

    while lower <= higher:
        middle = (lower + higher) / 2
        bid = list[middle]

        if bid == item:
            return middle

        if bid > item:
            higher = middle - 1
        else: 
            lower = middle + 1

