        if x < -1.5:
            state = 0
        elif x < 1.5:
            state = 1
        else:        
            state = 2

        # Check the state of x_dot.
        if x_dot < -0.5:
            state = state # No change
        elif x_dot < 0.5:
            state = state + 3
        else:
            state = state + 6

        # Check the state of theta.
        if theta < -six_degrees:  
            state = state # No change
