def _determinant_from_permutations(mat, permutations, signs):

    n = mat.shape[-1]
    sliced = (
        mat[..., torch.arange(n, device=mat.device), permutations].prod(dim=-1) * signs
    )
    return sliced.view(sliced.shape[0], -1).sum(dim=-1, keepdim=True)

